import styles from './postscreen.module.css'
import PostImage from '../../Componentes/PostImage'
import InteractionScreen from '../InteractionScreen'

export default function PostScreen(userInfo) {

    return (
        <div className={styles.container}>
            <PostImage postURL={userInfo.postURL} userName={userInfo.post}/>
            <InteractionScreen userInfo={userInfo}/>
        </div>
    )
}
